import React from 'react';

function Staff({ staffData}) {
    return (
        <ul>
            {staffData.map((staff) => {
                <li key={staff.id}>
                    Name: {staff.firstName} {staff.lastName}, Email: {staff.email}, Gender: {staff.gender}, Salary: {staff.salary}, Taxes: {staff.taxes}
                </li>
            })}
        </ul>
    );
}

export default Staff;
